import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';
import TableSortLabel from '@material-ui/core/TableSortLabel';
import Checkbox from '@material-ui/core/Checkbox';

const headCells = [
    { id:'documentName', numeric: false, label: 'documentName' },
    { id:'documentID', numeric: false, label: 'documentID' },
    { id:'resultKey', numeric: false, label: 'resultKey' },
    { id:'resultValue', numeric: false, label: 'resultValue' },
    { id:'resultValueExtracted', numeric: false, label: 'resultValueExtracted' },
    { id:'igniteElementID', numeric: false, label: 'igniteElementID' },
    { id:'disModified', numeric: false, label: 'isModified' },
    { id:'annotationID', numeric: false, label: 'annotationID' },
];

const tableHeadComponent = function tableHead(props){
    const { classes, onSelectAllClick, order, orderBy, numSelected, rowCount, onRequestSort } = props;
    const createSortHandler = (property) => (event) => {
        onRequestSort(event, property);
    };
    return(
        <TableHead>
                    <TableRow>
                        <TableCell padding='checkbox'>
                            <Checkbox onChange={onSelectAllClick}/>
                        </TableCell>
                        {headCells.map((headCell) => (
                            <TableCell key={headCell.id}>
                                <TableSortLabel>{headCell.label}</TableSortLabel>
                            </TableCell>
                        ))}
                    </TableRow>
                </TableHead>
    );
}

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
    },
    paper: {
        width: '100%',
        marginBottom: theme.spacing(2),
        backgroundColor: 'rgba(255,255, 255, 0.3)',
        textAlign: 'left',
        whiteSpace: 'wrap',
        overflow:'auto',
    },
    table: {
        minWidth: 750,

    },
    visuallyHidden: {
        border: 0,
        clip: 'rect(0 0 0 0)',
        height: 1,
        margin: -1,
        overflow: 'hidden',
        padding: 0,
        position: 'absolute',
        top: 20,
        width: 1,
    },
}));

export default function MainTable() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <Paper className={classes.paper}>
                <tableHead />
                <TableContainer>
                    <Table className={classes.table}>
                        <TableBody>

                        </TableBody>
                    </Table>
                </TableContainer>
            </Paper>
        </div>
    );
}
